import React from "react";
import sofaGreenMaria from "../images/sofaGreenMaria.PNG";
import chairStreetMaria from "../images/chairStreetMaria.PNG";
import sofaOwlMaria from "../images/sofaOwlMaria.PNG";
import index from "../stylesheets/index.css";

function Index() {
  return (
    <div
      class="bg_image"
      style={{
        backgroundImage: `url(${sofaGreenMaria})`,
        backgroundSize: "cover",
        height: "100vh",
      }}
    >
      <a href="/cello" style={{ fontSize: "2rem" }}>
        Cello
      </a>
      <a href="/aboutartist" style={{ fontSize: "2rem" }}>
        About The Artist
      </a>
      <a href="/recommendations" style={{ fontSize: "2rem", font: "bold" }}>
        Recommendations
      </a>
      <a href="/soundtracks" style={{ fontSize: "2rem" }}>
        Soundtracks For Sofas
      </a>
      <a href="/theworldaroundsofa" style={{ fontSize: "2rem" }}>
        The World Around Sofa
      </a>
      <a href="/aboutproject" style={{ fontSize: "2rem" }}>
        The Sofa Project
      </a>
    </div>
  );
}

export default Index;
